    false,nt"url": null,nt"notes": "This narrative report for Carolina Sandhills
    National Wildlife Refuge outlines Refuge accomplishments from August through October
    of 1940. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, furbearers,
    predators, and mammals- is also covered. The Refuge development and maintenance
    section discusses physical developments and plantings. Resource management is outlined;
    topics include sharecropping and timber removal. A progress report on field investigations
    and applied research is also provided. Photographs are attached.",nt"owner_org":
